class Solution(object):
    def pacificAtlantic(self, matrix):
        """
        :type matrix: List[List[int]]
        :rtype: List[List[int]]
        """
        m, n = len(matrix), len(matrix[0])
        dp_atlantic = [[False for i in range(len(matrix[0]))] for j in range(len(matrix))]
        dp_pacific =  [[False for i in range(len(matrix[0]))] for j in range(len(matrix))]
        movements = [[0, -1], [0, 1], [1, 0], [-1, 0]]
        def dfs_atlantic(i, j, prev):
            if dp_atlantic[i][j]:
                return dp_atlantic[i][j]
            if i == m - 1 or j == n - 1:
                dp_atlantic[i][j] = True
                return True
            ans = False
            for move in movements:
                new_i = i + move[0]
                new_j = j + move[1]
                if new_i >= 0 and new_i < m and new_j >= 0 and new_j < n and matrix[new_i][new_j] <= matrix[i][j] and [new_i, new_j] != prev:
                    ans = ans or dfs_atlantic(new_i, new_j, [i, j])
            dp_pacific[i][j] = True
            return True

        def dfs_pacific(i, j, prev):
            if dp_pacific[i][j]:
                return dp_pacific[i][j]
            if i == 0 or j == 0:
                dp_pacific[i][j] = True
                return True
            ans = False
            for move in movements:
                new_i = i + move[0]
                new_j = j + move[1]
                if new_i >= 0 and new_i < m and new_j >= 0 and new_j < n and matrix[new_i][new_j] <= matrix[i][j] and [new_i, new_j] != prev:
                    ans = ans or dfs_pacific(new_i, new_j, [i, j])
            dp_pacific[i][j] = True
            return True
        for i in range(m):
            for j in range(n):
                dfs_atlantic(i, j, [-1, -1])
                dfs_pacific(i, j, [-1, -1])
        answer = []
        for i in range(m):
            for j in range(n):
                if dp_pacific[i][j] and dp_atlantic[i][j]:
                    answer.append([i, j])
        return answer
